import React from "react";
import MainContainer from "./components/MainContainer";
import TopContainer from "./components/TopContainer";

const App = () => {

    document.getElementById('hamburguer').addEventListener("click", function toggleSideBar(){
        document.getElementById("sideBar").classList.toggle('open')
        document.getElementById('hamburguer').firstChild.classList.toggle('fa-arrow-right')
        document.getElementById('hamburguer').firstChild.classList.toggle('fa-bars')
    });

    return (
        <>
            <TopContainer />
            <MainContainer />
        </>
    )
}

export default App
